import './Profile.css';

const Profile = () => {
    return <div className='content'>
        <div>
            <img src='https://i.pinimg.com/originals/3c/52/28/3c52281d3b74f3b8e4f616b8be0695dc.jpg' />
        </div>
        <div> ava + description</div>
        <div>My post</div>
        <div>New post</div>
        <div>post 1</div>
        <div>post 2</div>
    </div>
      
}

export default Profile;
